    edges = []
    for i in range(n - 1):
        a, b = map(int, stdin.readline().split())
        edges.append((a - 1, b - 1))
    from collections import defaultdict
    graph = defaultdict(list)
    for a, b in edges:
        graph[a].append(b)
        graph[b].append(a)
    from queue import Queue
    q = Queue()
    q.put(0)
    visited = [False] * n
    visited[0] = True
    count = [0] * n
    while not q.empty():
        u = q.get()
        for v in graph[u]:
            if not visited[v]:
                visited[v] = True
                count[v] = count[u] + 1
                q.put(v)
    res = 0
    a, b, c = None, None, None
    for i in range(n):
        for j in range(n):
            for k in range(n):
                if count[i] + count[j] + count[k] > res:
                    res = count[i] + count[j] + count[k]
                    a, b, c = i, j, k
    return f"{res}\n{a + 1} {b + 1} {c + 1}"

