def solution(stdin: str) -> str:
    n, m, k = map(int, stdin.readline().strip().split())
    a = [list(map(int, stdin.readline().strip().split())) for _ in range(n)]
    # possible numbers to select
    nums = set(range(1, k+1))
    # dp[i][j] = max possible sum of elements in row i and column j
    dp = [[0] * m for _ in range(n)]
    for i in range(n):
        for j in range(m):
            # initialize dp[i][j] as 0
            dp[i][j] = 0
            # if current element is in possible numbers, add it to dp[i][j]
            if a[i][j] in nums:
                dp[i][j] = a[i][j]
            # iterate over all previous rows
            for r in range(i):
                # iterate over all previous columns
                for c in range(j):
                    # if dp[r][c] is divisible by k and (a[r][c]+a[i][j]) is also divisible by k,
                    # update dp[i][j] as max(dp[i][j], dp[r][c]+a[r][c]+a[i][j])
                    if dp[r][c] % k == 0 and (dp[r][c]+a[r][c]+a[i][j]) % k == 0:
                        dp[i][j] = max(dp[i][j], dp[r][c]+a[r][c]+a[i][j])
            # iterate over all previous columns
            for c in range(j):
                # if dp[i-1][c] is divisible by k and (dp[i-1][c]+a[i][j]) is also divisible by k,
                # update dp[i][j] as max(dp[i][j], dp[i-1][c]+a[i][j])
                if dp[i-1][c] % k == 0 and (dp[i-1][c]+a[i][j]) % k == 0:
                    dp[i][j] = max(dp[i][j], dp[i-1][c]+a[i][j])
            # if dp[i][j] is divisible by k, add it to dp[i][j]
            if dp[i][j] % k == 0:
                dp[i][j] += a[i][j]
    # iterate over all elements in the last row
    max_sum = 0
    for j in range(m):
        # if dp[n-1][j] is divisible by k, update max_sum as max(max_sum, dp[n-1][j])
        if dp[n-1][j] % k == 0:
            max_sum = max(max_sum, dp[n-1][j])
    return max_sum

