def solution(stdin: str) -> str:
    n, k = map(int, stdin.strip().split())

    # initialize the array a with all 1's
    a = [1] * k

    # calculate the total number of problems that Polycarp can solve in k days
    total = sum(a)

    # if total is greater than n, it is impossible to train
    if total > n:
        return "NO"

    # if total is equal to n, there is only one possible array a
    if total == n:
        return "YES\n" + " ".join(map(str, a))

    # if total is less than n, there are multiple possible arrays a
    for i in range(k):
        # if a[i] is equal to n, skip this day
        if a[i] == n:
            continue

        # otherwise, adjust a[i] until it satisfies the conditions
        while a[i] > 0 and (i == k - 1 or a[i] < a[i + 1] or a[i] > 2 * a[i]):
            a[i] -= 1

            # if a[i] becomes zero, it is impossible to satisfy the conditions, so return NO
            if a[i] == 0:
                return "NO"

            # if a[i] is less than a[i+1], adjust a[i+1] as well
            if i < k - 1 and a[i] < a[i + 1]:
                a[i + 1] -= 1

    # if we have reached this point, it is possible to train, so return YES and a
    return "YES\n" + " ".join(map(str, a))

