def solution(stdin: str) -> str:
    """
    Solves the problem of finding a spanning tree with maximum degree of any vertex
    """
    # Read the input
    n, m = map(int, stdin.readline().split())
    graph = [[] for _ in range(n)]
    for i in range(m):
        v, u = map(int, stdin.readline().split())
        graph[v-1].append(u-1)
        graph[u-1].append(v-1)

    # Initialize a parent list and a visited list
    parent = [-1] * n
    visited = [False] * n

    # Find any spanning tree
    for i in range(n):
        if not visited[i]:
            visited[i] = True
            for j in graph[i]:
                if not visited[j]:
                    parent[j] = i
                    visited[j] = True
                    break

    # Find the maximum degree over all vertices
    max_degree = 0
    for i in range(n):
        degree = 0
        for j in graph[i]:
            if parent[j]!= i:
                degree += 1
        if degree > max_degree:
            max_degree = degree

    # Print the edges of the spanning tree
    spanning_tree = []
    for i in range(n):
        for j in graph[i]:
            if parent[j] == i:
                spanning_tree.append((i, j))
    spanning_tree = set(spanning_tree)
    max_degree_edges = []
    for i in range(n):
        for j in graph[i]:
            if parent[j]!= i and (parent[i], j) not in spanning_tree:
                max_degree_edges.append((i, j))
                spanning_tree.add((parent[i], j))

    return "\n".join(map(lambda x: f"{x[0]+1} {x[1]+1}", max_degree_edges))

