    # Initialize variables
    gold = 0
    traps = []
    position = (0, 0)
    directions = [(0, 1), (0, -1), (1, 0), (-1, 0)]

    # Helper function to check if position is within map bounds
    def in_bounds(pos):
        return 0 <= pos[0] < w and 0 <= pos[1] < h

    # Helper function to check if position is a trap
    def is_trap(pos):
        return map_[pos[1]][pos[0]] == 'T'

    # Helper function to check if position is a gold
    def is_gold(pos):
        return map_[pos[1]][pos[0]] == 'G'

    # Helper function to check if position is a wall
    def is_wall(pos):
        return map_[pos[1]][pos[0]] == '#'

    # Helper function to move in a direction
    def move(pos, direction):
        new_pos = (pos[0] + direction[0], pos[1] + direction[1])
        if in_bounds(new_pos) and not is_wall(new_pos):
            return new_pos
        else:
            return pos

    # Helper function to get all positions in a given direction
    def get_directions(pos, direction):
        positions = []
        new_pos = move(pos, direction)
        if is_gold(new_pos):
            gold += 1
            new_pos = move(pos, direction)
        if is_trap(new_pos):
            traps.append(new_pos)
        positions.append(new_pos)
        return positions

    # Main function to find optimal path to gold
    def find_gold():
        queue = [(position, 0)]
        while queue:
            pos, dist = queue.pop(0)
            if is_gold(pos):
                return dist
            for direction in directions:
                new_pos = move(pos, direction)
                if in_bounds(new_pos) and not is_wall(new_pos):
                    queue.append((new_pos, dist+1))
        return -1

    # Find optimal path to gold and update gold count and trap positions
    path_length = find_gold()
    for trap in traps:
        gold += path_length - 1

    return str(gold)

