    n = int(stdin.split()[0])
    d = list(map(int, stdin.split()[1:]))
    # We need to find the shortest path between each pair of nodes in the graph,
    # where the graph is represented as a dictionary of dictionaries.
    # We can use a Bellman-Ford algorithm to find the shortest path.
    # However, since the graph is a DAG (directed acyclic graph), we can use a topological sort to simplify the algorithm.
    # The topological sort guarantees that we can process each node in order.
    # We can use a queue to implement the topological sort.
    # The time complexity of the Bellman-Ford algorithm is $O(mn)$, where $m$ is the number of edges and $n$ is the number of nodes.
    # However, since $m \leq n(n-1)$, the algorithm is actually faster in practice.
    # We can initialize the distances to infinity, except for the source node (which is 0), and set the source node as the current node.
    # For each current node, we can iterate through its neighbors and update their distances if the distance to the current node plus the weight of the edge is shorter.
    # After processing all nodes, we can return the distances from the source node to each node.
    # If there is a negative cycle, the distances from the source node to any node will be negative, and we can detect this by checking if the distance to any node changes in the last iteration.
    # If there is a negative cycle, we can return an error message.
    distances = [float('inf')]*n
    distances[0] = 0
    queue = [0]
    for i in range(n-1):
        for j in range(len(queue)):
            u = queue[j]
            for v in range(n):
                if d[u] == v-u-1:
                    if distances[u]+1 < distances[v]:
                        distances[v] = distances[u]+1
        queue = []
        for j in range(n):
            if distances[j] < float('inf'):
                queue.append(j)
        for j in range(len(queue)):
            u = queue[j]
            for v in range(n):
                if d[u] == v-u-1:
                    if distances[u]+1 < distances[v]:
                        return "Error: Negative cycle detected"
    return " ".join(map(str, distances[1:]))

