            table[i//5][i%5] = alphabet[i]
    # Encrypt plaintext
    encrypted = ''
    for i in range(0, len(plaintext), 2):
        c1, c2 = plaintext[i:i+2]
        if c1 == 'x' or c2 == 'x':
            raise ValueError('Input contains two ’x’s following each other or an ’x’ as the last character')
        # Check if both letters are the same or only one letter is left
        if c1 == c2 or (c1 not in 'abcdefghijklmnopqrstuvwxyz' or c2 not in 'abcdefghijklmnopqrstuvwxyz'):
            c1, c2 = c1+'x', c2+'x'
        # Check if both letters are in the same row or column
        elif c1 in [table[0][j] for j in range(5)] or c1 in [table[i][0] for i in range(5)]:
            if c2 in [table[0][j] for j in range(5)]:
                c1, c2 = table[0][(ord(c1)-ord('a')+1)%5], table[0][(ord(c2)-ord('a')+1)%5]
